import React, { useEffect } from 'react'
import { CheckUserLoggedIn } from './config/functions';

function App() {

  const checkLogin = () =>{

    if(!CheckUserLoggedIn){
      window.location = "/authen";
    }
  }

  useEffect(()=>{
    checkLogin()
  },[])

  return (
    <></>
  )
}

export default App
